import './Expenses.css';
import ExpenseItem from "./ExpenseItem";
import ExpensesFilter from "../ExpenseFilter/ExpensesFilter";

const Expenses = (props) => {
    return (
        <div>
            <ExpensesFilter />
            {props.expenses.map((expense) =>
                <ExpenseItem
                    id={expense.id}
                    key={expense.id}
                    title={expense.title}
                    amount={expense.amount}
                    date={expense.date}
                />
            )}
        </div>
    );
}

export default Expenses;
